const Hello = (props) => {
  return(<div>Hello {props.name}</div>);
}
const App = () => {
  console.log("Hello!");
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="Akua"/>
      <Hello name="Sven"/>
    </div>

  );
}

export default App;
